      margin-bottom: 0;
    }

    &--1 {
      grid-column: 1 / 5;

      @include onDesktop {
        grid-column: 1 / 4;
      }
    }

    &--2 {
      grid-column: 5/9;

      @include onDesktop {
        grid-column: 4 / 7;
      }
    }

    &--3 {
      grid-column: 1/5;

      @include onDesktop {
        grid-column: 3 / 6;
      }
    }
    &--4 {
      grid-column: 5/9;

      @include onDesktop {
        grid-column: 6 / 9;
      }
    }
    &--5 {
      grid-column: 1/5;

      @include onDesktop {
        grid-column: 1 / 4;
      }
    }
    &--6 {
      grid-column: 5/9;

      @include onDesktop {
        grid-column: 4 / 7;
      }
    }
  }

  &__subtitle {
    margin-bottom: 8px;
    font-weight: 500;
    line-height: 100%;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: #7f8096;
  }

  &__img {
    width: 100%;
    margin-bottom: 16px;

    object-fit: contain;
    object-position: center;
    border-radius: 8px;
    @include transition;

    &:hover {
      border-radius: 32px;
      transform: scale(1.05);
    }
  }

  &__paragraph {
    margin-bottom: 24px;
  }

  &__link {
    font-weight: 500;
    line-height: 100%;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    text-decoration: none;
    color: $red;

    &::before {
      content: "";
      display: inline-block;

      width: 16px;
      height: 16px;
      margin-right: 8px;

      background-image: url("../images/icons/arrow.svg");
      @include bg-center(contain);
      @include transition;
    }
    &:hover::before {
      transform: rotate(360deg) scale(1.5);
    }
  }
}

